import "./AddDiary.css";
const AddDiary = () => {
  return (
    <div className="modal absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2">
      <input className="input" placeholder="Name Of Your Diary"></input>
      <div className="dropdown">
        <span>Choose Format</span>
        <div className="dropdown-content">
          <button className="btn">Food Diary</button>
        </div>
      </div>
    </div>
  );
};
export default AddDiary;
